import { useDispatch } from "react-redux";
import {NAV_TOGGLE} from "redux/slices/navSlice";

import ToggleButton from "components/ToggleButton";
import FlexRow from "layout/FlexRow";

import styles from "./features.module.css";

import arrow_logo from 'images/arrows.png';
import logo from 'images/logo.png';

export default function Header() {
    const dispatch = useDispatch();
    const imageLeft = false;

    const Toggle = () => {
        console.log('toggle');
        dispatch(NAV_TOGGLE());
        if(imageLeft === true) {
            document.getElementById('arrow-toggle').style.transform = `rotate(180deg)`;
        } else {
            document.getElementById('arrow-toggle').style.transform = `rotate(360deg)`;
        }
        imageLeft = !imageLeft;
    }

    return (
        <header>
            <FlexRow>
                <ToggleButton clickHandler={Toggle} icon={arrow_logo} name={'arrow-toggle'}/>
            </FlexRow>
        </header>
    );
}
